import {postsType} from "../components/Profile";
import {dialogsType, messagesType} from "../components/Dialogs/Dialogs";
import any = jasmine.any;


export type StatePropsType = {
    profilePage: ProfilePageType
    dialogsPage: DialogsPageType

}
type AddPostActionType={
    type:'ADD-POST'

}
export type ProfilePageType = {
    posts: Array<postsType>
    newPostText: string

}
export type DialogsPageType = {
    dialogs: Array<dialogsType>
    messages: Array<messagesType>
    newMessageBody: string
}

export  type StoreType={
    _state:StatePropsType
    _callSubsariber:( state: StatePropsType)=>void
    subscribe:(observer:()=>void)=>void
    getState:()=>StatePropsType
    dispatch:(action: any)=>void

}
type addPostType = {
    addPost: () => void

}

const ADD_POST = 'ADD-POST';
const UPDATE_NEW_POST_TEXT = 'UPDATE-NEW-POST-TEXT';
const UPDATE_NEW_MESSAGE_BODY = 'UPDATE-NEW-MESSAGE-BODY';
const SEND_MESSAGE='SEND-MESSAGE';

let store:StoreType = {
    _state: {
        profilePage: {
            posts: [
                {id: 1, message: 'Hi,how are you?', likeCounter: 12},
                {id: 2, message: "It's my first post", likeCounter: 11},
            ],
            newPostText: 'it-kamasutra.com'
        },
        dialogsPage: {
            dialogs: [
                {
                    id: 1,
                    name: 'Vadim',
                    src: 'data:image/jpeg;base64,'
                },
                {
                    id: 2,
                    name: 'Sveta',
                    src: 'data:image/jpeg;base64,'
                },
                {
                    id: 3,
                    name: 'Virtor',
                    src: 'data:image/jpeg;base64,'
                },
                {
                    id: 4,
                    name: 'Olga',
                    src: 'data:image/jpeg;base64,'
                },
                {
                    id: 5,
                    name: 'Kate',
                    src: 'data:image/jpeg;base64,'
                },
            ],
            messages: [
                {id: 1, message: 'Hi'},
                {id: 2, message: 'Yo'},
                {id: 3, message: 'Hello'},
                {id: 4, message: 'How are you?'}
            ],
            newMessageBody: ''
        }
    },
    _callSubsariber() {
        console.log('state changed')
    },

    getState() {
        return this._state;
    },
    subscribe(observer) {
        this._callSubsariber = observer;
    },

    dispatch(action: any) { //{type:'ADD-POST'}
        if (action.type === ADD_POST) {
            let newPost:postsType = {
                id: 5,
                message: this._state.profilePage.newPostText,
                likeCounter: 0
            };
            this._state.profilePage.posts.push(newPost);
            this._state.profilePage.newPostText = '';
            this._callSubsariber(this._state);
        } else if (action.type === UPDATE_NEW_POST_TEXT) {
            this._state.profilePage.newPostText = action.newText;
            this._callSubsariber(this._state)
        } else if (action.type === UPDATE_NEW_MESSAGE_BODY) {
            this._state.dialogsPage.newMessageBody = action.body;
            this._callSubsariber(this._state)
        } else if (action.type === SEND_MESSAGE) {
            let body = this._state.dialogsPage.newMessageBody;
            this._state.dialogsPage.newMessageBody='';
          this._state.dialogsPage.messages.push({id:6,message: body});
                      this._callSubsariber(this._state)
        }

    }
}
